    array = input("\033[1m\033[33m–í–≤–µ–¥—ñ—Ç—å —á–µ—Ä–µ–∑ –ø—Ä–æ–±—ñ–ª —Ü—ñ–ª—ñ —á–∏—Å–ª–∞, —è–∫—ñ –±–∞–∂–∞—î—Ç–µ –≤—ñ–¥—Å–æ—Ä—Ç—É–≤–∞—Ç–∏: \033[0m")
    array = array.split()
    try:
