void dijkstra(int start, float dist[], float r_speed) {
    bool visited[MAX_N] = {false};
    for (int i = 0; i < N; ++i) {
        dist[i] = INF;
    }
    dist[start] = 0;

    for (int i = 0; i < N; ++i) {
        int u = -1;
        for (int j = 0; j < N; ++j) {
            if (!visited[j] && (u == -1 || dist[j] < dist[u])) {
                u = j;
            }
        }

        if (dist[u] == INF) break;
        visited[u] = true;

        for (int v = 0; v < N; ++v) {
            if (graph[u][v] && dist[u] + graph[u][v] / r_speed < dist[v]) {
                dist[v] = dist[u] + graph[u][v]/r_speed;
            }
        }
    }
}

