struct node // —Å—Ç—Ä—É–∫—Ç—É—Ä–∞ –¥–ª—è –ø—Ä–µ–¥—Å—Ç–∞–≤–ª–µ–Ω–∏—è —É–∑–ª–æ–≤ –¥–µ—Ä–µ–≤–∞
{
    int info;//–∑–Ω–∞—á–µ–Ω–∏–µ
    node *left;//—Å—Å—ã–ª–∫–∞ –Ω–∞ –ª–µ–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
    node *right;//—Å—Å—ã–ª–∫–∞ –Ω–∞ –ø—Ä–∞–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
    int balance; // –ø–æ–ª–µ –±–∞–ª–∞–Ω—Å–∞= –≤—ã—Å–æ—Ç–∞ –ø—Ä–∞–≤–æ–≥–æ –ø–æ–¥–¥–µ—Ä–µ–≤–∞ - –≤—ã—Å–æ—Ç–∞ –ª–µ–≤–æ–≥–æ –ø–æ–¥–¥–µ—Ä–µ–≤–∞
};


int Height(node *root)// –≤—ã—á–∏—Å–ª—è–µ—Ç –≤—ã—Å–æ—Ç—É –¥–µ—Ä–µ–≤–∞
{
    if (root == nullptr) return 0;//–µ—Å–ª–∏ –¥–µ—Ä–µ–≤–æ –ø—É—Å—Ç–æ –≤–æ–∑–≤—Ä–∞—â–∞–µ–º 0
    //–∏–Ω–∞—á–µ
    int hLeft = Height(root->left),//—Å—á–∏—Ç–∞–µ–º –≤—ã—Å–æ—Ç—É –ª–µ–≤–æ–≥–æ –ø–æ–¥–¥–µ—Ä–µ–≤–∞
    hRight = Height(root->right); //—Å—á–∏—Ç–∞–µ–º –≤—ã—Å–æ—Ç—É –ø—Ä–∞–≤–æ–≥–æ –ø–æ–¥–¥–µ—Ä–µ–≤–∞
    return max(hLeft, hRight) + 1;

}

void SetBalance(node *(&root))//–Ω–∞—Ö–æ–∂–¥–µ–Ω–∏–µ –∑–Ω–∞—á–µ–Ω–∏–µ –±–∞–ª–∞–Ω—Å–∞ –¥–ª—è —Ç–µ–∫—É—â–µ–≥–æ —É–∑–ª–∞
{
    if (root != nullptr)
        root->balance = Height(root->right) - Height(root->left);
}

void TurnLeft(node *(&root))//–ª–µ–≤—ã–π –ø–æ–≤–æ—Ä–æ—Ç –ê–í–õ-–¥–µ—Ä–µ–≤–∞
{
    node *rightSubtree, *rightSubtreeLeftSubtree;
    rightSubtree = root->right;
    rightSubtreeLeftSubtree = rightSubtree->left;

    rightSubtree->left = root;
    root->right = rightSubtreeLeftSubtree;
    root = rightSubtree;
    SetBalance(root->left);
    SetBalance(root);
}

void TurnRight(node *(&root))//–ø—Ä–∞–≤—ã–π –ø–æ–≤–æ—Ä–æ—Ç
{
    node *leftSubtree, *leftSubtreeRightSubtree;
    leftSubtree = root->left;
    leftSubtreeRightSubtree = leftSubtree->right;

    leftSubtree->right = root;
    root->left = leftSubtreeRightSubtree;
    root = leftSubtree;
    SetBalance(root->right);
    SetBalance(root);
}


void insert(node *(&root), int d) // –¥–æ–±–∞–≤–ª–µ–Ω–∏–µ —É–∑–ª–∞ –≤ –¥–µ—Ä–µ–≤–æ –ø–æ–∏—Å–∫–∞
{
    if (root == nullptr)//–Ω–∞—à–ª–∏ –ø—É—Å—Ç–æ–π —É–∫–∞–∑–∞—Ç–µ–ª—å ‚Äì –ø—É—Å—Ç–æ–µ –º–µ—Å—Ç–æ
    { //—Å–æ–∑–¥–∞—ë–º –Ω–æ–≤—ã–π —É–∑–µ–ª –¥–µ—Ä–µ–≤–∞ –Ω–∞ –Ω–∞–π–¥–µ–Ω–Ω–æ–º –º–µ—Å—Ç–µ
        root = new node;
        root->info = d;
        root->balance = 0;
        root->left = nullptr;
        root->right = nullptr;
    }
    else//—Ç–µ–∫—É—â–∏–π —É–∑–µ–ª –Ω–µ –ø—É—Å—Ç
    {
        if (d > root->info)//–∏–¥—ë–º –≤ –ø—Ä–∞–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ

        {
            insert(root->right, d);//–¥–æ–±–∞–≤–ª—è–µ–º —É–∑–µ–ª –≤ –ø—Ä–∞–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
            if (Height(root->right) - Height(root->left) > 1)//–µ—Å–ª–∏ –±–∞–ª–∞–Ω—Å –ê–í–õ-–¥–µ—Ä–µ–≤–∞ –Ω–∞—Ä—É—à–µ–Ω
            {//–≤—ã–ø–æ–ª–Ω—è–µ–º –≤—Ä–∞—â–µ–Ω–∏—è
                if (Height(root->right->right) < Height(root->right->left))//–∞ –µ—Å–ª–∏ –±—ã–ª–∏ –µ—â–µ –ø—Ä–æ–±–ª–µ–º—ã –≤ –ø–æ–¥–¥–µ—Ä–µ–≤—å—è—Ö —É –ø—Ä–∞–≤–æ–≥–æ –ø–æ–¥–¥–µ—Ä–µ–≤–∞
                    TurnRight(root->right);//—Ç–æ –ø—Ä–µ–¥–≤–∞—Ä–∏—Ç–µ–ª—å–Ω–æ –ø–æ–≤–æ—Ä–∞—á–∏–≤–∞–µ–º –ø—Ä–∞–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
                TurnLeft(root);//–ø–æ–≤–æ—Ä–æ—Ç –¥–µ—Ä–µ–≤–∞ –≤–ª–µ–≤–æ
            }
        }
        else if (d < root->info)//–∏–¥—ë–º –≤ –ª–µ–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ

        {

            insert(root->left, d);//–¥–æ–±–∞–≤–ª—è–µ–º —É–∑–µ–ª –≤ –ª–µ–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
            if (Height(root->left) - Height(root->right) > 1)//–µ—Å–ª–∏ –±–∞–ª–∞–Ω—Å –ê–í–õ-–¥–µ—Ä–µ–≤–∞ –Ω–∞—Ä—É—à–µ–Ω
            {
                if (Height(root->left->left) < Height(root->left->right))//–∞ –µ—Å–ª–∏ –±—ã–ª–∏ –µ—â–µ –ø—Ä–æ–±–ª–µ–º—ã –≤ –ø–æ–¥–¥–µ—Ä–µ–≤—å—è—Ö —É –ª–µ–≤–æ–≥–æ –ø–æ–¥–¥–µ—Ä–µ–≤–∞
                    TurnLeft(root->left);//—Ç–æ –ø—Ä–µ–¥–≤–∞—Ä–∏—Ç–µ–ª—å–Ω–æ –ø–æ–≤–æ—Ä–∞—á–∏–≤–∞–µ–º –ª–µ–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
                TurnRight(root);//–ø–æ–≤–æ—Ä–æ—Ç –¥–µ—Ä–µ–≤–∞ –≤–ø—Ä–∞–≤–æ
            }
        }

        SetBalance(root);//–ø–µ—Ä–µ—Å—á–∏—Ç—ã–≤–∞–µ–º –∑–Ω–∞—á–µ–Ω–∏–µ –±–∞–ª–∞–Ω—Å–∞
    }
}

