void output(node *p)// —Ä–∞—Å–ø–µ—á–∞—Ç–∫–∞ –¥–µ—Ä–µ–≤–∞ –≤ —Å–∏–º–º–µ—Ç—Ä–∏—á–Ω–æ–º –ø–æ—Ä—è–¥–∫–µ
{
    if (p != nullptr)
    {
        output(p->left);
        cout << p->info << " ";
        output(p->right);
    }
}

void print_n(const node *p, int n, int level, int prob)//–ø–µ—á–∞—Ç—å n-–æ–≥–æ —É—Ä–æ–≤–Ω—è –¥–µ—Ä–µ–≤–∞, level - —ç—Ç–æ –Ω–æ–º–µ—Ä —É—Ä–æ–≤–Ω—è
{
    if (p)
    {
        if (level == n)
        {
            for (int i = 1; i <= prob; i++) cout << " ";
            cout << p->info;
        }
        else
        {
            print_n(p->left, n, level + 1, prob);
            print_n(p->right, n, level + 1, prob);
        }
    }
}

void print(node *p) //—Ä–∞—Å–ø–µ—á–∞—Ç–∫–∞ –¥–µ—Ä–µ–≤–∞ –ø–æ —É—Ä–æ–≤–Ω—è–º
{
    int h = Height(p);
    int prob = 3;
    if (p)
    {
        for (int i = 0; i <= h; i++)//–≤–æ—Ç –∑–¥–µ—Å—å –∑–∞–¥–∞—é—Ç—Å—è –Ω–æ–º–µ—Ä–∞ —É—Ä–æ–≤–Ω–µ–π
        {
            print_n(p, i, 0, prob*(h - i));//–≤—ã–∑—ã–≤–∞–µ—Ç—Å—è —Ñ—É–Ω–∫—Ü–∏—è –ø–µ—á–∞—Ç–∏ n-–æ–≥–æ —É—Ä–æ–≤–Ω—è –¥–µ—Ä–µ–≤–∞
            cout << endl;
        }
    }
    cout << "H " << h << endl;
}


