  color: #410000;
}

#workskin img {
  max-width: 100%;
  height: auto;
  -webkit-border-radius: 3px;
  border-radius: 3px;
  border: 0;
}

/* Esto modifica el borde solido de la zona de la descripci√≥n y notas */
#workskin .preface.group {
  padding: 20px;
  -webkit-border-radius: 5px;
  border-radius: 5px;
  border: 2px solid #edf5f3;
  -webkit-box-shadow: 0 2px 3px 0 #ccc;
  box-shadow: 0 2px 3px 0 #ccc;
}

/* Esto modifica el "Notes:" */
#workskin .preface.group div h3 {
  border: none;
  font-weight: 400;
  font-family: arial,helvetica,sans-serif;
  color: #e0b834;
  text-transform: uppercase;
  font-size: 16px;
  letter-spacing: 3px;
}

#workskin .preface.group h3.byline.heading {
  font-family: 'Lucida Grande','Lucida Sans Unicode','GNU Unifont',Verdana,Helvetica,sans-serif;
  font-style: normal;
}

/* Aqu√≠ empieza el bloque de cita*/
#workskin .userstuff blockquote {
  border: 0;
}

#workskin .userstuff blockquote {
  margin: 0;
  border-inline-start: 2px solid #e0b834;
}

#workskin .userstuff blockquote p {
  padding: 15px;
  background: #e0b834;
  border-radius: 5px;
  color: black;
}

#workskin .userstuff blockquote p::before {
  content: '\201C';
}

#workskin .userstuff blockquote p::after {
  content: '\201D';
}
/* Aqu√≠ termina el bloque de cita */

/* Esto cambia el nombre de autor */
#workskin .preface.group h3.byline.heading a {
  color: #e0b834;
  display: block;
  margin-bottom: 30px;
  text-transform: uppercase;
  font-size: 13px;
  letter-spacing: 3px;
}

/* Esto cambia el color de los enlaces en texto */
#workskin .preface.group a {
  text-decoration: none;
}

#workskin .link {
  color: #e0b834;
}

#workskin a:link {
  color: #e0b834;
  font-family: 'Lucida Grande','Lucida Sans Unicode','GNU Unifont',Verdana,Helvetica,sans-serif;
}

#workskin a:visited {
  color: #e0a434;
}

#workskin a:hover {
  color: #e0a434;
  font-weight: bold;
}

#workskin a:active {
  color: #e0b834;
}

#workskin ul li::marker {
  color: #e0b834;
}

#workskin p.image,
#workskin p.image img {
  padding: 0px;
  margin-block-end: 0px;
  margin-block-start: 0px;
  line-height: 0px;
}

#workskin p.image {
  margin: 0px auto;
}

#workskin p.image img {
  margin: 0px !important;
}
